import React from "react";

function Card() {
  return(


    <template id="item_template">
      <li class="element">
        <button class="element__delete-card" type="button"></button>
        <img class="element__photo" src="#" alt="Картинка" />
        <div class="element__title">
          <h2 class="element__text"></h2>
          <div class="element__group">
            <button class="element__like" type="button"></button>
            <p class="element__sum"></p>
          </div>
        </div>
      </li>
    </template>
  );
}

export default Card;
